                <Link to="/">Home</Link>
                <Link to="/create">New Blog</Link>
                <Link to="/contact">Contact Us!</Link>
                <input type="search" className="searchBar" id="yolo"></input>
        <Link to={`/blogs/${document.getElementById("yolo").value}`}>
        <button>Hello!</button>
    </Link>
            </div>
        </nav>
    );
}

export default Navbar;
